#include <iostream>\n#include <vector>\n#include <unordered_map>\n\nint findMaxFrequency(const std::vector<int>& nums) {\n    std::unordered_map<int, int> frequencyMap;\n    \n    // Count the frequency of each number\n    for (int num : nums) {\n        frequencyMap[num]++;\n    }\n    \n    // Find the maximum frequency\n    int maxCount = 0;\n    for (const auto& pair : frequencyMap) {\n        if (pair.second > maxCount) {\n            maxCount = pair.second;\n        }\n    }\n    \n    return maxCount;\n}\n\nint main() {\n    std::vector<int> a = {2, 456, 34, 3456, 2, 435, 2, 456, 2};\n    int maxFrequency = findMaxFrequency(a);\n    \n    std::cout << "The highest frequency is: " << maxFrequency << std::endl;\n    return 0;\n}